import styled, { keyframes } from 'styled-components';

import Backdrop from '../../UI/Backdrop';

function Modal({ ...props }) {
	const expandingAnimation = keyframes`
	0% {height: 0vh; width: 0vw}
	20% {height: 20vh; width: 20vw}
	40% {height: 40vh; width: 40vw}
	60% {height: 60vh; width: 60vw}
	80% {height: 80vh; width: 80vw}
	100% {height: 100vh; width: 100vw}
	`;
	const Wrapper = styled.div`
		display: flex;
		flex-direction: column;
		align-items: center;
		background-color: white;
		border: 0.1rem solid black;
		border-radius: 0.4rem;
		position: absolute;
		top: 50%;
		left: 50%;
		transform: translate(-50%, -50%);
		animation-name: ${expandingAnimation};
		animation-duration: 2s;
	`;

	return (
		<Backdrop>
			<Wrapper>{props.children}</Wrapper>
		</Backdrop>
	);
}

export default Modal;
